drop table board_Enabled cascade constraints; 
DROP SEQUENCE BE_ID_seq;
drop table channel_Enabled cascade constraints; 
DROP SEQUENCE CE_ID_seq;
/
CREATE TABLE board_Enabled
(  BE_ID NUMBER PRIMARY KEY,
	link_ID INT NOT NULL,
   SOL_CRATE VARCHAR(20) NOT NULL,
   enable_Mask VARCHAR(64) NOT NULL,
   CH_SIDE VARCHAR(20) NOT NULL,
   CH_ID INT NOT NULL,
   SLAT_ID INT NOT NULL,
   STATION_ID INT NOT NULL,
    DS_CHAMBER VARCHAR(60) NOT NULL,
  DS_CHILDREN VARCHAR(60) NOT NULL,
  DS_SOLARFSM VARCHAR(60) NOT NULL,
   SOL_ID VARCHAR(60) NOT NULL
);
create sequence BE_ID_seq;

create or replace trigger trg_BE_id
     before insert on board_Enabled
     for each row
   begin
     select BE_ID_seq.nextval
       into :new.BE_ID
       from dual;
   end;
  /
CREATE TABLE channel_Enabled
(  CE_ID NUMBER PRIMARY KEY,
   link_ID INT NOT NULL,
   board_ID NUMBER NOT NULL,
   enable_Mask VARCHAR(16) NOT NULL   
);
create sequence CE_ID_seq;

create or replace trigger trg_CE_id
     before insert on channel_Enabled
     for each row
   begin
     select CE_ID_seq.nextval
       into :new.CE_ID
       from dual;
   end;
  /



COMMIT;